    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>Several electrical circuits of the
    COPAGETEL project are presented for operation, in this case there are
    several fans for cooling the peltier cells, but also for system cooling
    purposes there are reflux fans, extraction fans, and also the recirculation
    fan, all this is in the assembly and the container in general, as mentioned
    everything is connected to the main board, the Arduino Mega in this case, a
    12 vdc at 2 A power supply is required, starting from the main source.</span><span
    lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:
    "Calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:

    COPAGETEL project are presented for operation, in this case there are
    several peltier cells distributed in 3 banks, they are located at the
    bottom of the project, this is used to control the temperature in each
    section, when the step limit is used, also for temperature tests, in
    negative values &#8203;&#8203;all this is in the assembly and the container
    in general, as mentioned everything is connected to the main board, the
    Arduino Mega in this case, a 12 vdc at 8 A power supply is required,
    starting from the main source.</span><span lang=EN-US style='font-size:
